import React from 'react';
import './index.css';

function Intro() {
  return (
    <div id="hero" className="jumbotron container-fluid">
      <div className="container ">
        <h1>Hello, My name is Israel Guillermo.</h1>
        <h1>I am a Junior Software Engineer.</h1>
      </div>
    </div>
  );
}

export default Intro;
